import React, { useState, useEffect } from "react";
import axios from "axios";
import { motion } from "framer-motion";
import "tailwindcss/tailwind.css";

function CompetitorAnalysis() {
  const [username, setUsername] = useState("");
  const [channelData, setChannelData] = useState(null);
  const [videos, setVideos] = useState([]);
  const [keywordAnalysis, setKeywordAnalysis] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const fetchKeywordAnalysis = async () => {
    try {
      const response = await axios.get("http://localhost:5000/videos");
      setKeywordAnalysis(response.data);
    } catch (err) {
      setError("Failed to fetch keyword analysis.");
    }
  };

  const fetchVideos = async () => {
    setLoading(true);
    setError(null);

    try {
      const videoResponse = await axios.post("http://localhost:5000/analyze", { username });
      if (videoResponse.data.error) throw new Error(videoResponse.data.error);
      
      setChannelData(videoResponse.data.channelData);
      setVideos(videoResponse.data.videos);
      await fetchKeywordAnalysis();
    } catch (err) {
      setError("Failed to fetch data. Check the username and API.");
    }

    setLoading(false);
  };

  useEffect(() => {
    fetchKeywordAnalysis();
  }, []);

  return (
    <div className="bg-gradient-to-r from-blue-500 to-blue-700 min-h-screen text-white font-sans flex flex-col items-center p-10">
      <motion.h1 initial={{ opacity: 0 }} animate={{ opacity: 1 }} transition={{ duration: 1 }} className="text-4xl font-bold mb-6">
        SEO Tube: AI-Powered YouTube Growth
      </motion.h1>
      
      <div className="bg-white p-6 rounded-lg shadow-lg w-full max-w-2xl text-gray-900">
        <input
          type="text"
          placeholder="Enter Competitor's Channel Name"
          value={username}
          onChange={(e) => setUsername(e.target.value)}
          className="w-full p-3 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
        />
        <button
          onClick={fetchVideos}
          className="mt-4 w-full bg-blue-500 hover:bg-blue-600 text-white py-3 rounded-md transition"
        >
          Analyze Channel
        </button>
      </div>
      
      {loading && <p className="mt-6">Loading...</p>}
      {error && <p className="text-red-500 mt-4">{error}</p>}
      
      {channelData && (
        <motion.div initial={{ opacity: 0 }} animate={{ opacity: 1 }} transition={{ duration: 1 }} className="mt-8 bg-white p-6 rounded-lg shadow-lg w-full max-w-2xl">
          <h2 className="text-2xl font-bold">{channelData.title}</h2>
          <p className="text-lg">Subscribers: {channelData.subscriberCount}</p>
        </motion.div>
      )}
      
      <div className="mt-6 w-full max-w-2xl">
        {videos.map((video) => (
          <motion.div key={video.videoId} initial={{ opacity: 0 }} animate={{ opacity: 1 }} transition={{ duration: 0.8 }} className="bg-white p-4 rounded-md shadow-md mb-4">
            <a href={`https://www.youtube.com/watch?v=${video.videoId}`} target="_blank" rel="noopener noreferrer" className="text-blue-500 text-lg font-semibold hover:underline">{video.title}</a>
            <p className="text-gray-700">Views: {video.views} | Likes: {video.likes} | Comments: {video.comments}</p>
          </motion.div>
        ))}
      </div>
      
      {keywordAnalysis && (
        <motion.div initial={{ opacity: 0 }} animate={{ opacity: 1 }} transition={{ duration: 1 }} className="mt-8 bg-white p-6 rounded-lg shadow-lg w-full max-w-2xl">
          <h3 className="text-2xl font-bold">Keyword Analysis</h3>
          <p className="mt-2"><strong>Top Keywords:</strong> {keywordAnalysis.keywords?.join(", ")}</p>
          <p><strong>Top Bigrams:</strong> {keywordAnalysis.bigrams?.join(", ")}</p>
          <p><strong>Top Trigrams:</strong> {keywordAnalysis.trigrams?.join(", ")}</p>
          <p><strong>TF-IDF Scores:</strong> {JSON.stringify(keywordAnalysis.tfidfScores)}</p>
          <p><strong>Trending Keywords:</strong> {keywordAnalysis.trendingKeywords?.join(", ")}</p>
          <p><strong>Suggested Video Title:</strong> {keywordAnalysis.suggestedTitle}</p>
          <p><strong>Suggested Tags:</strong> {keywordAnalysis.suggestedTags?.join(", ")}</p>
        </motion.div>
      )}
    </div>
  );
}

export default CompetitorAnalysis;
